import React from 'react'

export default function Beliefs() {
    return (
        <section id="belief" className="belief">
        <div className="container">
            <h1>What We Believe</h1>
            <ul>
            <li><p>That the <strong>Holy Bible</strong>, consisting of 39 books of the Old Testament and 27 books of the New Testament, is the inspired Word of God. We take the bible as final authority in all matters concerning Christian conduct and work; it is the only standard of truth and the only model of pure religion. 2Tim. 3:16:17, pro. 30:5, 6; Rev. 22: 18, 19. </p></li>
            </ul>
        </div>
        </section>
    )
}
